    function  executeOperation (
        address _reserve,
        uint256 _amount,
        uint256 _fee,
        bytes calldata _params
    )
    external override
    {
        require(_amount <= getBalanceInternal(address(this), _reserve), "Invalid balance, was the flashLoan successful?");

        emit LoanTaken(pairA,_amount,_fee);

        (uint decodedType, bool test) = decode(_params);

        if(decodedType == 1){
            WBNBBridgedSwap(_amount, _fee, test);
        }else{
            if(decodedType == 2){
                directTokenSwap(minimumProfit, _amount, _fee, test);
            }else{
                if(decodedType == 3){
                    DynamicPathWBNBBridgedSwap(_amount, _fee, test);
                }else{
                    if(decodedType == 4){
                        DynamicPathWBNBBridgedSwapWithFees(_amount, _fee, test);
                    }else{
                        if(decodedType == 5){
                            DynamicPathWBNBBridgedSingleStepSwap(_amount, _fee, test);
                        }
                    }
                }
            }
        }

        // Time to transfer the funds back
        uint totalDebt = _amount.add(_fee);
        transferFundsBackToPoolInternal(_reserve, totalDebt);
        emit LoanPayed(pairA, _amount, _fee);
    }

